import React from 'react';
import ReactDOM from 'react-dom/client';

import './index.css';
import App from './App';
import Array from './Array';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App texto="Registros" />

    <Array prefix="Mr." texto={{nome:'Nicchon',sobrenome:'Sanchez',idade:22}} />
    <Array prefix="Mrs." texto={{nome:'Gabriela',sobrenome:'Perin',idade:20}} />
  </React.StrictMode>
);
